import webD from "../src/images/s1.jpg";
import app from "../src/images/s2.webp";
import software from "../src/images/s3.jpg";
import machine from "../src/images/s4.avif";
import marketing from "../src/images/s5.webp";
import seo from "../src/images/s6.avif";



const Sdata = [
    {
        imgsrc: webD,
        title: "Web Development"
    },
    {
        imgsrc: app,
        title:"App Development"
    },
    {
        imgsrc: software,
        title:"Software Development"
    },
    {
        imgsrc: machine,
        title: "Machine Learning"
    },
    {
        imgsrc: marketing,
        title: "Digital Marketing"
    },
    {
        imgsrc: seo,
        title: "SEO"
    }
];

export default Sdata;
